import fetch from "node-fetch";

function Blog() {
  return (
    <ul>
      <li>Post 1</li>
      <li>Post 2</li>
    </ul>
  );
}

export async function getStaticProps() {
  const res = await fetch("http://www.omdbapi.com/?s=avengers&apikey=158fe49");
  const data = await res.json();
  const posts = await data.Search;

  return {
    props: {
      posts,
    },
  };
}

export default Blog;
